INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(3, 'node', ' news in tegenstelling tot wat algemeen aangenomen wordt is lorem ipsum niet zomaar willekeurige tekst het heeft zijn wortels in een stuk klassieke latijnse literatuur uit 45 vchr en is dus meer dan 2000 jaar oud richard mcclintock een professor latijn aan de hampdensydney college in virginia heeft één van de meer obscure latijnse woorden consectetur uit een lorem ipsum passage opgezocht en heeft tijdens het zoeken naar het woord in de klassieke literatuur de onverdachte bron ontdekt lorem ipsum komt uit de secties 11032 en 11033 van de finibus bonorum et malorum de uitersten van goed en kwaad door cicero geschreven in 45 vchr dit boek is een verhandeling over de theorie der ethiek erg populair tijdens de renaissance de eerste regel van lorem ipsum lorem ipsum dolor sit amet komt uit een zin in sectie 11032  ', 1448394823),
(4, 'node', ' rooms er zijn vele variaties van passages van lorem ipsum beschikbaar maar het merendeel heeft te lijden gehad van wijzigingen in een of andere vorm door ingevoegde humor of willekeurig gekozen woorden die nog niet half geloofwaardig ogen als u een passage uit lorum ipsum gaat gebruiken dient u zich ervan te verzekeren dat er niets beschamends midden in de tekst verborgen zit alle lorum ipsum generators op internet hebben de eigenschap voorgedefinieerde stukken te herhalen waar nodig zodat dit de eerste echte generator is op internet het gebruikt een woordenlijst van 200 latijnse woorden gecombineerd met een handvol zinsstructuur modellen om een lorum ipsum te genereren die redelijk overkomt de gegenereerde lorum ipsum is daardoor altijd vrij van herhaling ingevoegde humor of ongebruikelijke woorden etc  ', 1448394847);
